    alignItems: 'center',
    '@media (max-width: 768px)': {
      padding: 32
    }
  },
  logosSectionTitle: {
    fontSize: 24,
    color: colors.text.secondary,
    marginBottom: 32,
    textAlign: 'center'
  },
  logosGrid: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    justifyContent: 'center',
    gap: 48,
    maxWidth: 1200,
    width: '100%',
    '@media (max-width: 768px)': {
      gap: 24
    }
  },
  logo: {
    fontSize: 24,
    color: colors.text.primary,
    opacity: 0.7
  },
  readMoreSection: {
    padding: 64,
    backgroundColor: colors.background.primary,
    alignItems: 'center',
    '@media (max-width: 768px)': {
      padding: 32
    }
  },
  readMoreTitle: {
    fontSize: 24,
    color: colors.text.primary,
    marginBottom: 32,
    textAlign: 'center'
  },
  readMoreLinks: {
    flexDirection: 'row',
    gap: 24,
    '@media (max-width: 768px)': {
      flexDirection: 'column',
      gap: 16
    }
  },
  readMoreButton: {
    backgroundColor: colors.background.secondary,
    paddingHorizontal: 24,
    paddingVertical: 12,
    borderRadius: 8,
    borderWidth: 1,
    borderColor: colors.primary
  },
  readMoreButtonText: {
    color: colors.primary,
    fontSize: 16,
    fontWeight: 'bold'
  }
});
